.dropdown {
  width: 100%;
  min-height: 40px;
  position: relative;
  display: inline-block;
  margin-right: 1em;
  overflow: hidden;
  cursor: pointer;
  text-align: left;
  white-space: nowrap;
  outline: none;
  border: 1px solid transparent;
}

.dropdown:not(.expanded) {
  max-height: 40px;
}

.dropdown .select-wrapper {
  display: block;
  height: 40px;
  line-height: 40px;
  padding-left: 1em;
  padding-right: 3em;
  cursor: pointer;
  position: relative;
}

.dropdown .select-wrapper.selected {
  position: absolute;
  top: 0;
  left: 0;
}

.dropdown::after {
  content: "â–¾";
  position: absolute;
  right: 0.8em;
  top: 0.7em;
}

.dropdown.selected {
  padding-top: 40px;
}

.dropdown:not(.expanded).selected .select-wrapper:not(.selected) {
  display: none;
}

.dropdown:not(.expanded) .select-wrapper:not(:first-child) {
  display: none;
}

.dropdown:not(.expanded).selected .select-wrapper.selected {
  display: block;
}

.dropdown.expanded {
  border: 1px solid #3694d7;
  background: white;
  border-radius: .25em;
  box-shadow: rgba(0, 0, 0, 0.1) 3px 3px 5px 0;
}

.dropdown.expanded .select-wrapper:not(:first-child) {
  border-top: 0.06em solid #d9d9d9;
}

.dropdown.expanded .select-wrapper:hover, .dropdown.expanded .select-wrapper.selected {
  color: #3694d7;
}

.dropdown.expanded::after {
  transform: rotate(-180deg);
  top: 0.8em;
}

.dropdown.selected .select-wrapper.selected {
  border: none;
}

.dropdown.selected .select-wrapper:not(selected) {
  border-top: 0.06em solid #d9d9d9;
}

